[Form]
public final class BOMReportFinish extends FormRun
{
    BOMmultiReportFinish                multiReportFinish;
    QueryBuildRange                     criteriaParm;

    InventDimCtrl_Frm_Setup             inventDimFormSetup;

    #ISOCountryRegionCodes
    // <GIN>
    boolean isIsoIN;
}

// </GIN>
void closeOk()
{
    if (multiReportFinish.checkCloseDialog(element))
    {
        super();
    }
}

void doReselect()
{
    BOMParmReportFinish tmpBOMparmReportFinish;

    tmpBOMparmReportFinish.data(boMparmReportFinish);

    boMparmReportFinish_ds.executeQuery();

    if (tmpBOMparmReportFinish)
    {
        boMparmReportFinish_ds.positionToRecord(tmpBOMparmReportFinish);
    }
}

void init()
{
    super();

    multiReportFinish    = element.args().caller().runbase();

    element.updateDesign(InventDimFormDesignUpdate::Init);

    // <GIN>
    isIsoIN = SysCountryRegionCode::isLegalEntityInCountryRegion([#isoIN]);
    // </GIN>
}

Object inventDimSetupObject()
{
    return inventDimFormSetup;
}

RunBase runBase()
{
    return multiReportFinish;
}

public void setBOMVersion(TransDate  _bomDate, FromQty _fromQty, InventDim _inventDim)
{
    BOMId       activeBOMId;

    activeBOMId = BOMVersion::findActive(bomParmReportFinish.ItemId, _bomDate, _fromQty, _inventDim).bomId;

    if (bomParmReportFinish.bomId != activeBOMId)
    {
        if (bomParmReportFinish.promptChangeBOM())
        {
            bomParmReportFinish.bomId     = activeBOMId;

            bomParmReportFinish_ds.refresh();
        }
    }
}

/// <summary>
///     Sets inventory dimensions for currently selected item.
/// </summary>
public void setInventDimId()
{
    inventDim.data(InventDim::find(boMparmReportFinish.InventDimId));

    inventDim_ds.setCurrent();
}

void updateDesign(InventDimFormDesignUpdate mode)
{
    switch (mode)
    {
        case InventDimFormDesignUpdate::Init            :
            if (! inventDimFormSetup)
            {
                inventDimFormSetup  = InventDimCtrl_Frm_Setup::newFromFormGridField(element,fieldNum(InventDimSetupGrid,ShowGridBOMMain));
            }
        // No break
        case InventDimFormDesignUpdate::Active          :
            inventDimFormSetup.formActiveSetup(InventDimGroupSetup::newItemId(boMparmReportFinish.ItemId));
            inventDimFormSetup.formSetControls(true);
            break;
        case InventDimFormDesignUpdate::FieldChange     :
            inventDimFormSetup.formActiveSetup(InventDimGroupSetup::newItemId(boMparmReportFinish.ItemId));
            inventDimFormSetup.formSetControls(false);
            break;
        default : throw error(strFmt("@SYS54195",funcName()));
    }
}

private void updateTransTaxInformation()
{
    if (bomParmReportFinish.RecId)
    {
        ttsbegin;
        TransTaxInformation transTaxInformation = TransTaxInformationHelper::findOrCreateTransTaxInformationByRecord(bomParmReportFinish, true);
        transTaxInformation.CompanyLocation = TaxLogisticsLocationControllerHelper_IN::getDefaultLogisticsLocation(inventDim.InventLocationId, inventDim.InventSiteId);
        transTaxInformation.TaxInformation = TaxInformation_IN::findDefaultbyLocation(transTaxInformation.CompanyLocation).RecId;
        TransTaxInformationHelper::initFromTaxInformation(transTaxInformation);
        transTaxInformation.doUpdate();
        ttscommit;
    }
}

public boolean validateWrite()
{
    boolean         ret;
    InventSiteId    bomSiteId;

    bomParmReportFinish.InventDimId = InventDim::findOrCreate(inventDim).InventDimId;

    ret = super();

    if (ret)
    {
        bomSiteId = BOMTable::find(bomParmReportFinish.bomId).SiteId;
        if (bomSiteId && inventDim.InventSiteId != bomSiteId)
        {
            ret = checkFailed("@SYS109260");
        }
    }

    return ret;
}

public void write()
{
    ttsbegin;

    boMparmReportFinish.InventDimId    = InventDim::findOrCreate(inventDim).InventDimId;
    super();

    if (boMparmReportFinish.InventDimId != inventDim.InventDimId)
    {
        element.setInventDimId();
    }

    ttscommit;
}

void initValue()
{
    BOMmultiReportFinish_Journal    multiReportFinish_Journal;

    multiReportFinish.initParmBuffer(boMparmReportFinish);

    if (classidget(multiReportFinish) == classnum(BOMmultiReportFinish_Journal))
    {
        multiReportFinish_Journal = multiReportFinish;
        boMparmReportFinish.initFromInventJournalTrans(multiReportFinish_Journal.parmInventJournalTrans());
    }
    boMparmReportFinish.ParmId      = multiReportFinish.parmId();
    boMparmReportFinish.RecId       = 0;

    super();
}

void init()
{
    super();

    criteriaParm = this.query().dataSourceNo(1).addRange(fieldnum(BOMParmReportFinish,ParmId));
}

void executeQuery()
{
    criteriaParm.value(queryValue(multiReportFinish.parmId()));

    super();
}

int active()
{
    int ret;

    ret = super();

    element.updateDesign(InventDimFormDesignUpdate::Active);

    return ret;
}

