}

public void lookup(FormControl _formControl, str _filterStr)
{
    BOMReportFinishBase::lookupTransIdReturnBOMForm(_formControl, bomParmReportFinish_ds);
}

public boolean validate()
{
    boolean ret;

    ret = super();

    if (#PmfEnabled && BOMParmReportFinish.inventTable().PmfProductType != PmfProductType::BOM)
    {
        ret = ret && checkFailed(strfmt("@PRO2863", bomParmReportFinish.inventTable().ItemType));
    }

    return ret;
}

public void modified()
{
    super();

    boMparmReportFinish.initFromInventTable(InventTable::find(boMparmReportFinish.ItemId));

    element.setInventDimId();

    element.updateDesign(InventDimFormDesignUpdate::Active);
}

public void lookup(FormControl _formControl, str _filterStr)
{
    if (#PmfEnabled)
    {
        InventTable::lookupBOMItemId(_formControl);
    }
    else
    {
        super(_formControl, _filterStr);
    }
}

public void modified()
{
    super();

    bomParmReportFinish.Qty = decround(bomParmReportFinish.Qty, UnitOfMeasure::unitOfMeasureDecimalPrecision(
        UnitOfMeasure::unitOfMeasureIdBySymbol(InventTableModule::find(bomParmReportFinish.ItemId,ModuleInventPurchSales::Invent).UnitId)));
    element.setBOMVersion(bomParmReportFinish.TransDate, bomParmReportFinish.Qty, inventDim);
}

